export const filtrarDatos = (datos) => {
    var curso = '';
    var fecha = '';
    var alumnos = '';

    return new Promise((resolve, reject) => {
        curso = datos[0][0];
        curso = curso.substring(15, curso.length);

        fecha = datos[2][1];
        fecha = new Date(fecha);
        console.log(fecha);




    });
};
